void movefireboy(int* RVALID1, int* PS2_data1, char* byte1a, char* byte1b, char* byte1c, 
					int* goingup1, int* falling1, int* dir1, int* heightcount, int blocked, 
				   	int up, int down, int left, int right, int b){
	
	if (*RVALID1) {
		*byte1a = *byte1b;
		*byte1b = *byte1c;
		*byte1c = *PS2_data1 & 0xFF; //(bit 7-0)
		
		if (*byte1c == up && *goingup1 == 0 && *falling1 == 0){ //key W = up
			*goingup1 = 1; 
		}
		if (*byte1c == down){ //key S = down 
			if (*byte1b == b){
				*dir1 |= 0b0100; 
			}
			else if (*byte1b == 0xF0){
				*dir1 &= 0b1011; 
			}
		}
		
		if (*byte1c == left){ //key S = down 
			if (*byte1b == b){
				*dir1 |= 0b1000; 
			}
			else if (*byte1b == 0xF0){
				*dir1 &= 0b0111; 
			}
		}
		
		if (*byte1c == right){ //key S = down 
			if (*byte1b == b){
				*dir1 |= 0b0001; 
			}
			else if (*byte1b == 0xF0){
				*dir1 &= 0b1110; 
			}
		}

	}

	//check if player in the air 
	if (*goingup1 == 1){
		if (*heightcount <= 30 && !blocked){
			*dir1 |= 0b0010; 
			(*heightcount)++; 
		}
		else {
			*heightcount = 0; 
			*goingup1 = 0;
			*falling1 = 1; 
			*dir1 &= 0b1101; 
		}
	}
	else if (*falling1 == 1){
		//check if player is falling 
		*dir1 |= 0b0100; 
		*goingup1 = 0;
	}
	else if (*falling1 == 0){
		//check if player is done falling 
		*dir1 &= 0b1011;
		*goingup1 = 0;
	}
	
}

void movewatergirl(int* RVALID1, int* PS2_data1, char* byte1a, char* byte1b, char* byte1c, 
					int* goingup1, int* falling1, int* dir1, int* heightcount, int blocked, 
				   	int up, int down, int left, int right){
	
	if (*RVALID1) { //if keyboard is pressed 
		*byte1a = *byte1b;
		*byte1b = *byte1c;
		*byte1c = *PS2_data1 & 0xFF; //(bit 7-0)
		if (*byte1c == up && *goingup1 == 0 && *falling1 == 0){ //key W = up
			*goingup1 = 1; 
		}
		else if (*byte1c == down && *byte1b != 0xF0){ //key S = down 
			*dir1 |= 0b0100; 
		}
		else if (*byte1c == left && *byte1b != 0xF0){ //key A = left 
			*dir1 |= 0b1000;
		}
		else if (*byte1c == right && *byte1b != 0xF0){ //key D = right 
			*dir1 |= 0b0001; 
		}
		else {
			*dir1 &= 0b0010; 
		}
	}

	//check if player in the air 
	if (*goingup1 == 1){
		
		if (*heightcount <= 30 && !blocked){
			*dir1 |= 0b0010; 
			(*heightcount)++; 
		}
		else {
			*heightcount = 0; 
			*goingup1 = 0;
			*falling1 = 1; 
			*dir1 &= 0b1101; 
		}
	}
	else if (*falling1 == 1){
		//check if player is falling 
		*dir1 |= 0b0100; 
		*goingup1 = 0;
	}
	else if (*falling1 == 0){
		//check if player is done falling 
		*dir1 &= 0b1011;
		*goingup1 = 0;
	}
	
}

void wait_for_vsync(){
	volatile int *fbuf = (int*) 0xFF203020;
	int status;
	*fbuf = 1; 
	status = *(fbuf + 3);
	
	while( (status & 0x01) != 0) {
		status = *(fbuf + 3);
	}
}
					   
